import './App.css';
import { reduxForm, Field } from 'redux-form';

function App() {
  return (
    <div className="App">
      <Field type="text" component="input"></Field>
    </div>
  );
}

App = reduxForm({
  // a unique name for the form
  form: 'contact'
})(App)
export default App;
